import EditableTable from '../components/table/EditableTable';

function JobTable(props) {
  return (
    <>
      <JobTable
        showSearch="none"
        showIcon="none"
        jobTitleT="Job Title"
        jobTitle="title"
        jobLocationT="Job Location"
        jobLocation="location"
        // location1="New York"
        // location2="London"
        startDateT="Start Date"
        startDate="Sdate"
        endDateT="End Date"
        endDate="Edate"
        statusT="Status"
        status="status"
      />
    </>
  );
}

export default JobTable;
